import React from 'react';
import ReactDOM from 'react-dom';
import {add,sub,div,mul} from './Calc';

function List() {
    return (
        <ol>
            <li>{`add = ${add(20, 3)}`}</li>
            <li>{`difference = ${sub(20, 3)}`}</li>
            <li>{`division = ${div(20, 4)}`}</li>
            <li>{`multiplication = ${mul(20, 3)}`}</li>
        </ol>
    );
}

export default List;
